notes:
- API key acts like a password for all subsequent requests
- Basic authentication is not encrypted before transfer
- Default BFDMultiplier is 3, can be between 2 and 20
- Default BFDTimer is 500, can be between 10 and 100000
- Default BFDDestinationIPType is IPV4
- The scope of the entity can be either Data center or Enterprise level.
- The local routing policies assigned to an NSG in a policy binding are preferred
  over global routing policies defined at the OSPF instance level.
- 'IP Type of the syslog IP Address. Supported values: ''IPV4'''
- 'The protocol type of the syslog server. Supported values: ''UDP'''
- Defines a MAP between the private ip and public ip.
- This object has no members.
- Set the attributes like NSG role, authentication method etc for establishing IKE
  security association with remote gateway.
- Password of the default user associated to the access profile must be between 8
  and 512 characters.
- Netconf session port default value is 830
- Download rate limit used for download of Gateway image in kilobyte per second (KB/s)
  is default 10000, min 32, max 1073741824.
- The ID of the associated Enterprise is represented by associatedEnterpriseID.
- A description of the Profile instance created is represented by description.
- DR Seed Lifetime in seconds is represented by DRSeedLifetime.
- Entity scope can be either ENTERPRISE or GLOBAL.
- The scope of entity can be Data center or Enterprise level
- A map can contain one or more ranges defining the available channels.
- Ranges are non overlapping within a single map.
- The OSPF instance allows you to assign global import and export routing policies
  for OSPF traffic in the domain.
- Applicable to shared infrastructure enterprise subnets.
- Download rate limit for this uplink in Mb/s is default 8.0.
- Indicates whether PAT is enabled on the underlay for this uplink connection is default
  true.
- Specify if scope of entity is Data center or Enterprise level
- Pre-created matching criteria that allows CSPRoot to auto-assign incoming auto-bootstrapping
  requests to an Enterprise should a match occur.
- represents a application with L4/L7 classification
- This entity is read only. Read only objects cannot be modified or deleted.
- The action of the ACL entry can be DROP, FORWARD, or REDIRECT.
- The enterprise name is required and read-only.
- Service is a port range and protocol combination that can be used in ACLs
- Actions REDIRECT and FORWARDING_PATH_LIST are allowed only for IngressAdvancedForwardingEntry.
- 'Burst Size: The maximum burst size associated with the QoS Policer in kilo-bits;
  only whole values are supported.'
- 'Rate: Bandwidth that is allowed in Mb/s; only whole values supported.'
- Successive Probe threshold. Applicable only if this URL's parent is Tier1
- packet count (part of rate along with probeInterval). Applicable only if this URL's
  parent is Tier1
- Weight of the URL in %. Applicable only when parent is Tier1
- probe interval (part of rate along with packetCount). Applicable only if this URL's
  parent is Tier1
- number of milliseconds to wait until the probe is timed out. Applicable only if
  this URL's parent is Tier1
- Number of times the probe is allowed to retry on successive timeouts. Applicable
  only for TIER2 has a default value of 5.
- probe interval has a default value of 10.
- packet count has a default value of 1.
- Default value for pageSize is 50
- Some attributes are read-only and cannot be modified.
- To enable LDAP authorization for an enterprise, both authorizationEnabled and enabled
  attributes must be set to true.
- User needs to have CMS privileges to use proxy user header.
- Some objects may return nulls in deeply nested fields
- Requires the VRS to be configured correctly for integration.
- The behavioral and deployment information of a VNF is defined in the VNF descriptor
  template.
- UUID of the entity to which the vport is associated to can be a UUID of a SUBNET
  or a L2DOMAIN.
- Indicates if this endpoint is the source/destination of a network connection.
- Needs to be in CIDR format x.x.x.x/n
- The associated service id.
- The associated network object id.
- The associated network object type. Refer to API section for supported types.
- Description of the application tier must be under 255 characters.
- External object ID is used for integration with third party systems.
- The netmask and gateway fields are required for the application tier.
- No authentication required.
